export const normalize = (val, max, min) => {
	return (val - min) / (max - min)
}

/**
 * Get distance between two sets of [ lat, lng ]
 *
 * @param coord1 {Array} - First set of [ lat, lng ]
 * @param coord2 {Array} - Second set of [ lat, lng ]
 * @param unit {String} - Unit of measure to return
 *		(Miles by default, 'K' for kilometers, 'N' for nautical miles)
 *
 * @return dist {Number}
 */
export const distance = (coord1 = [ 0, 0 ], coord2 = [ 0, 0 ], unit) => {
	let radlat1 = Math.PI * coord1[0] / 180
	let radlat2 = Math.PI * coord2[0] / 180
	let theta = coord1[1] - coord2[1]
	let radtheta = Math.PI * theta / 180
	let dist = Math.sin(radlat1) * Math.sin(radlat2) + Math.cos(radlat1) * Math.cos(radlat2) * Math.cos(radtheta);

	dist = Math.acos(dist)
	dist = dist * 180/Math.PI
	dist = dist * 60 * 1.1515

	if (unit=="K") { dist = dist * 1.609344 }
	if (unit=="N") { dist = dist * 0.8684 }

	return dist
}

/**
 * Formats double digit decimal for displaying money
 *
 * @param price {Number} - Price value
 *
 * @return double digit decimal {Number}
 */
export const formatPrice = (price) => {
	return Number
		.parseFloat(price)
		.toFixed(2)
		.replace('.00', '')
}

export const formatNumber = (num) => {
	return num.toLocaleString('en-US')
}

export const formatPhoneNumber = (phoneNumberString) => {
	let cleaned = ('' + phoneNumberString).replace(/\D/g, '')
	let match = cleaned.match(/^(\d{3})(\d{3})(\d{4})$/)

	if (match) {
		return '(' + match[1] + ') ' + match[2] + '-' + match[3]
	}

	return phoneNumberString
}

