export const cleanDescription = (description) => {
	return description
		.replace(/(?:\r\n|\r|\n)/g, '<br />')
		.replace(/ style=\"(|.)+?\"/g, '')
}

export const stripHtml = (str) => {
	if (typeof str !== 'string') {
		return str
	}

	return str
		.replace(/<(br|\/p).*?>/gm, ' ')
		.replace(/<(?:.|\n)*?>|"/gm, ' ')
		.trim()
}

export const toTitleCase = (str) => {
	return str
		.replace(/\w\S*/g, (txt) => {
			return txt.charAt(0).toUpperCase() + txt.substr(1).toLowerCase()
		})
		// All uppercase
		.replace(/dj\s|r&b/ig, (txt) => {
			return txt.toUpperCase()
		})
		// All lowercase
		.replace(/\s(of\s|and\s|a\s|the\s)/ig, (txt) => {
			return txt.toLowerCase()
		})
		// Hyphenated words
		.replace(/.-./ig, (txt) => {
			return txt.charAt(0) + txt.charAt(1) + txt.charAt(2).toUpperCase()
		})
}

export const formatTitleFromLineup = (lineup = [], prepend = '') => {
	let artistName
	let title = ''
	let truncateTitle

	for (let i = 0; i < lineup.length; i++) {
		artistName = lineup[i].artists.name || lineup[i].artists[0].name

		// first artist
		if (i === 0) {
			title += artistName
		}

		// middle
		if (lineup.length > 1 && i < lineup.length - 1 && i > 0) {
			title += `, ${artistName}`
		}

		// end
		if (i === lineup.length - 1) {
			if (lineup.length > 2) {
				title += `, and ${artistName}`
			}
			else if (lineup.length === 2) {
				title += ` and ${artistName}`
			}
		}
	}

	return `${prepend}${title}`
}

export function camelCaseToKebabCase(str) {
	return str.trim().toLowerCase().replace(' ', '-')
}

export const localStorageExpire = {
	set(variable, value, ttl_ms) {
		if (typeof localStorage === 'undefined') {
			return
		}

		let data = {
			value: value,
			expires_at: new Date().getTime() + ttl_ms / 1
		}

		localStorage.setItem(variable.toString(), JSON.stringify(data))
	},

	get(variable) {
		if (typeof localStorage === 'undefined') {
			return
		}

		let data = JSON.parse(localStorage.getItem(variable.toString()))

		if (data !== null) {
			if (data.expires_at !== null && data.expires_at < new Date().getTime()) {
				localStorage.removeItem(variable.toString())
			} else {
				return data.value
			}
		}

		return null
	}
}

