/**
 * Cleans object of unset values
 *
 * @param object {Object} - Object to be purged
 * @return purge {Object} - Object with purged key/values
 */
export const purge = (object) => {
	let keys = Object.keys(object)
	let purge = {}

	keys.forEach((key, index) => {
		if (object[key]) {
			purge[key] = object[key]
		}
	})

	return purge
}

export const verifyOwner = (user, show) => (
	user &&
	existsWithKey(show, 'organizer') &&
	user.id === show.organizer.id
)

export const cleanUser = (user) => {
	let _cleanUser = {}

	if (user.email) _cleanUser.email = user.email
	if (user.firstName) _cleanUser.firstName = user.firstName
	if (user.username) _cleanUser.username = user.username
	if (user.time_zone) _cleanUser.time_zone = user.time_zone
	if (user.type) _cleanUser.type = user.type

	// Avatar
	if (user.photo && user.photo.secure_url) {
		_cleanUser.avatar = user.photo.secure_url
		_cleanUser.photo = user.photo.secure_url
	}
	else if (user.avatar) {
		_cleanUser.avatar = user.avatar
	}

	if (Array.isArray(user.genres)) {
		_cleanUser.genres = user.genres.slice(0, 20)
	}

	return _cleanUser
}

export const events = (function(){
	let topics = {}
	let hOP = topics.hasOwnProperty

	return {
		subscribe: function(topic, listener) {
			// Create the topic's object if not yet created
			if (!hOP.call(topics, topic)) topics[topic] = []

			// Add the listener to queue
			let index = topics[topic].push(listener) -1

			// Provide handle back for removal of topic
			return {
				remove: function() {
					delete topics[topic][index]
				}
			}
		},

		publish: function(topic, info) {
			// If the topic doesn't exist, or there's no listeners in queue, just leave
			if (!hOP.call(topics, topic)) return

			// Cycle through topics queue, fire!
			topics[topic].forEach(function(item) {
				let evt  = info != undefined ? info : {}
				let _evt = evt.topic = topic

				item(evt)
			})
		}
	}
})()

export const isFeatured = (featured) => {
	return (featured && featured.startDate && moment(featured.startDate).isAfter(getCurrentDate()))
}

export const isEmpty = (obj) => {
    for (var prop in obj) {
        if (obj.hasOwnProperty(prop)) {
        	return false
        }
    }

    return true
}

//
// Check if an object exists, and if it does
// verifies if the provided key is within the object
//
export const existsWithKey = (obj, key) => {
	if (!obj) {
		return false
	}

	if (obj && !obj[key]) {
		return false
	}

	return true
}

//
// Color Helpers
//
export const convertColor = (color) => {
	/* Check for # infront of the value, if it's there, strip it */

	if (color.substring(0,1) == '#') {
		color = color.substring(1)
	}

	let rgbColor = []

	/* Grab each pair (channel) of hex values and parse them to ints using hexadecimal decoding */
	rgbColor.push(parseInt(color.substring(0,2),16))
	rgbColor.push(parseInt(color.substring(2,4),16))
	rgbColor.push(parseInt(color.substring(4),16))

	return rgbColor
}
